Carlito  sou evangélica, me sinto até envergonhada, não sei o quê pensar.
Tinha amigas, achava quê tinham princípio de caratê. Valores; 
Más, depois quê passaram a defender bulsonaro foram  corrompida, eu vejo diante de mim pessoas enlouquecidas cheio de ódio  e intolerância.  . Tenho minhas convicção..voto em Lula   estou na luta ...💃💃🤍🚩
